  // Carregar banco de dados de licenÃ§as
  async loadLicenseDatabase() {
    try {
      const result = await window.webStorage.loadData("license_database")
      if (result.success && result.data) {
        // Converter objeto para Map
        this.licenseDatabase = new Map(Object.entries(result.data))
      }
    } catch (error) {
      console.error("Erro ao carregar banco de licenÃ§as:", error)
    }
  }

  // Salvar banco de dados de licenÃ§as
  async saveLicenseDatabase() {
    try {
      // Converter Map para objeto
      const dataObject = Object.fromEntries(this.licenseDatabase)
      await window.webStorage.saveData("license_database", dataObject)
    } catch (error) {
      console.error("Erro ao salvar banco de licenÃ§as:", error)
    }
  }

  // Gerar chave de licenÃ§a
  generateLicenseKey(planType, customerId = null, expiryDays = 365) {
    const timestamp = Date.now()
    const random = Math.random().toString(36).substr(2, 4).toUpperCase()
    
    // Prefixos por tipo de plano
    const prefixes = {
      'free': 'FREE',
      'basic': 'BASI',
      'premium': 'PREM', 
      'enterprise': 'ENTP',
      'trial': 'TRIL'
    }

    const prefix = prefixes[planType] || 'UNKN'
    const year = new Date().getFullYear()
    
    // Formato: PREF-YEAR-RAND-XXXX
    const part1 = prefix
    const part2 = year.toString()
    const part3 = random
    const part4 = this.generateChecksum(prefix + year + random)

    const licenseKey = `${part1}-${part2}-${part3}-${part4}`

    // Criar registro da licenÃ§a
    const licenseData = {
      key: licenseKey,
      planType: planType,
      customerId: customerId || `cust_${timestamp}`,
      createdAt: new Date().toISOString(),
      expiresAt: new Date(Date.now() + (expiryDays * 24 * 60 * 60 * 1000)).toISOString(),
      status: 'active',
      activations: 0,
      maxActivations: this.getMaxActivations(planType),
      features: this.getPlanFeatures(planType),
      deviceIds: [],
      lastValidation: null,
      metadata: {
        generatedBy: 'admin',
        version: '1.0.0',
        notes: ''
      }
    }

    // Salvar no banco de dados
    this.licenseDatabase.set(licenseKey, licenseData)
    this.saveLicenseDatabase()

    return licenseData
  }

  // Gerar checksum para validaÃ§Ã£o
  generateChecksum(input) {
    let hash = 0
    for (let i = 0; i < input.length; i++) {
      const char = input.charCodeAt(i)
      hash = ((hash << 5) - hash) + char
      hash = hash & hash // Convert to 32-bit integer
    }
    return Math.abs(hash).toString(36).substr(0, 4).toUpperCase()
  }

  // Obter mÃ¡ximo de ativaÃ§Ãµes por plano
  getMaxActivations(planType) {
    const limits = {
      'free': 1,
      'basic': 3,
      'premium': 5,
      'enterprise': 10,
      'trial': 1
    }
    return limits[planType] || 1
  }

  // Obter recursos do plano
  getPlanFeatures(planType) {
    const features = {
      'free': ['basic_closing', 'single_user'],
      'basic': ['basic_closing', 'multi_user', 'basic_reports', 'email_support'],
      'premium': ['advanced_closing', 'unlimited_users', 'advanced_reports', 'cloud_backup', 'priority_support'],
      'enterprise': ['enterprise_closing', 'unlimited_users', 'custom_reports', 'api_access', 'dedicated_support', 'multi_store'],
      'trial': ['premium_trial', 'all_features', 'trial_support']
    }
    return features[planType] || []
  }

  // Validar chave de licenÃ§a
  validateLicense(licenseKey, deviceId = null) {
    const license = this.licenseDatabase.get(licenseKey)
    
    if (!license) {
      return {
        valid: false,
        error: 'LICENSE_NOT_FOUND',
        message: 'Chave de licenÃ§a nÃ£o encontrada'
      }
    }

    // Verificar se estÃ¡ ativa
    if (license.status !== 'active') {
      return {
        valid: false,
        error: 'LICENSE_INACTIVE',
        message: 'LicenÃ§a inativa ou suspensa'
      }
    }

    // Verificar expiraÃ§Ã£o
    if (new Date() > new Date(license.expiresAt)) {
      return {
        valid: false,
        error: 'LICENSE_EXPIRED',
        message: 'LicenÃ§a expirada'
      }
    }

    // Verificar limite de ativaÃ§Ãµes
    if (deviceId) {
      if (!license.deviceIds.includes(deviceId)) {
        if (license.activations >= license.maxActivations) {
          return {
            valid: false,
            error: 'MAX_ACTIVATIONS_REACHED',
            message: 'Limite mÃ¡ximo de ativaÃ§Ãµes atingido'
          }
        }
        
        // Adicionar novo dispositivo
        license.deviceIds.push(deviceId)
        license.activations++
      }
    }

    // Atualizar Ãºltima validaÃ§Ã£o
    license.lastValidation = new Date().toISOString()
    this.licenseDatabase.set(licenseKey, license)
    this.saveLicenseDatabase()

    return {
      valid: true,
      license: license,
      message: 'LicenÃ§a vÃ¡lida'
    }
  }

  // Revogar licenÃ§a
  revokeLicense(licenseKey, reason = 'Manual revocation') {
    const license = this.licenseDatabase.get(licenseKey)
    
    if (license) {
      license.status = 'revoked'
      license.revokedAt = new Date().toISOString()
      license.revocationReason = reason
      
      this.licenseDatabase.set(licenseKey, license)
      this.saveLicenseDatabase()
      
      return true
    }
    
    return false
  }

  // Estender licenÃ§a
  extendLicense(licenseKey, additionalDays) {
    const license = this.licenseDatabase.get(licenseKey)
    
    if (license) {
      const currentExpiry = new Date(license.expiresAt)
      const newExpiry = new Date(currentExpiry.getTime() + (additionalDays * 24 * 60 * 60 * 1000))
      
      license.expiresAt = newExpiry.toISOString()
      license.extendedAt = new Date().toISOString()
      license.extensionDays = additionalDays
      
      this.licenseDatabase.set(licenseKey, license)
      this.saveLicenseDatabase()
      
      return true
    }
    
    return false
  }

  // Gerar mÃºltiplas licenÃ§as
  generateBulkLicenses(planType, quantity, expiryDays = 365) {
    const licenses = []
    
    for (let i = 0; i < quantity; i++) {
      const license = this.generateLicenseKey(planType, null, expiryDays)
      licenses.push(license)
    }
    
    return licenses
  }

  // Exportar licenÃ§as para CSV
  exportLicensesToCSV() {
    const headers = ['Chave', 'Plano', 'Cliente', 'Criada em', 'Expira em', 'Status', 'AtivaÃ§Ãµes']
    const rows = [headers]
    
    for (const [key, license] of this.licenseDatabase) {
      rows.push([
        license.key,
        license.planType,
        license.customerId,
        new Date(license.createdAt).toLocaleDateString('pt-BR'),
        new Date(license.expiresAt).toLocaleDateString('pt-BR'),
        license.status,
        `${license.activations}/${license.maxActivations}`
      ])
    }
    
    const csvContent = rows.map(row => row.join(',')).join('\n')
    
    // Download do arquivo
    const blob = new Blob([csvContent], { type: 'text/csv' })
    const url = URL.createObjectURL(blob)
    const a = document.createElement('a')
    a.href = url
    a.download = `licencas_${new Date().toISOString().split('T')[0]}.csv`
    document.body.appendChild(a)
    a.click()
    document.body.removeChild(a)
    URL.revokeObjectURL(url)
  }

