  // Calcular estatÃ­sticas por plano
  calculatePlanStats(licenses) {
    const stats = {}
    licenses.forEach(license => {
      stats[license.planType] = (stats[license.planType] || 0) + 1
    })
    return stats
  }

  // Obter licenÃ§as expirando em 30 dias
  getExpiringLicenses() {
    const thirtyDaysFromNow = new Date(Date.now() + (30 * 24 * 60 * 60 * 1000))
    return Array.from(this.licenseDatabase.values())
      .filter(license => {
        const expiry = new Date(license.expiresAt)
        return expiry <= thirtyDaysFromNow && expiry > new Date() && license.status === 'active'
      })
      .sort((a, b) => new Date(a.expiresAt) - new Date(b.expiresAt))
      .slice(0, 5)
  }

  // Obter ativaÃ§Ãµes recentes
  getRecentActivations() {
    return Array.from(this.licenseDatabase.values())
      .filter(license => license.lastValidation)
      .sort((a, b) => new Date(b.lastValidation) - new Date(a.lastValidation))
      .slice(0, 5)
  }

